// SPDX-License-Identifier: MIT
pragma solidity ^0.6.10;

contract enumSample {

    enum PizzaSize {Small, Medium, Large}
    
    PizzaSize public choice;
    PizzaSize constant defaultChoice = PizzaSize.Small;

    address public owner;
    mapping(address => PizzaSize) public userChoices;

    event PizzaChosen(address indexed user, PizzaSize size);

    constructor() public {
        owner = msg.sender;
        choice = defaultChoice;  // initialize with default
    }

    function setChoice(PizzaSize _size) public {
        choice = _size;
        userChoices[msg.sender] = _size;
        emit PizzaChosen(msg.sender, _size);
    }

    function getChoice() public view returns (PizzaSize) {
        return userChoices[msg.sender];
    }

    function getDefaultChoice() public pure returns (PizzaSize) {
        return defaultChoice;
    }

    function getNumericValue(PizzaSize _size) public pure returns (uint8) {
        return uint8(_size);
    }
}
